// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract FinanceControl {
    address public owner;
    mapping (address => uint) public payments;

    constructor() {
        owner = msg.sender;
    }

    function pay() public payable {
        payments[msg.sender] = msg.value;
    }

    function withdrawAll(address payable _to, uint _amount) public {
        require(_amount > 0, "_amount must be > 0");
        require(_to != address(0), "to must be a real address"); //0x0000000000000000000000000000000000000000 - нулевой адрес
        _to.transfer(_amount);
    }


}

